;; **
;;; # Ceres Analytics
;; **

;; @@
(ns squealing-dawn
  (:require [gorilla-plot.core :as plot]
            [ceres-analytics.core :refer [db degrees]]
            [gg4clj.core :as gg4clj]
            [incanter.stats :refer [mean variance quantile sd]]))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-nil'>nil</span>","value":"nil"}
;; <=

;; @@
(let [degree-freq (->> @degrees (map second) frequencies)
      data {:x (keys degree-freq)
            :y (vals degree-freq)}]
(gg4clj/view
    [[:<- :d (gg4clj/data-frame data)]
     (gg4clj/r+
       [:ggplot :d [:aes :x :y]]
       [:geom_bar {:stat "identity"}]
       [:xlab "X Axis"]
       [:ylab "Y Axis"]
       [:ggtitle "Mixed Bar Chart"])]
    {:width 10
     :height 6}))
